*
* Step 1: Create Provider File
*
* For USA,Canada use zip or postal code(no spaces)
* example
* USA ZipCode 10001 --------------> <channel update="i" site="ontvtonight" site_id="10001" xmltv_id="dummy">dummy</channel>
* <update>c1-Providers-10001</update>
* Canada Postal Code M1R3C7 ------> <channel update="i" site="ontvtonight" site_id="M1R3C7" xmltv_id="dummy">dummy</channel>
* <update>c1-Providers-M1R3C7</update>
*
* For UK,select region from the following list
* -----------------
* London
* Border+England
* Border+Scotland
* Cambridgeshire
* Central
* Channel+Islands
* Granada
* Meridian
* Northern+Ireland
* STV+Central
* STV+North
* Tyne+Tees
* Wales
* West
* West+Country
* Yorkshire
* -----------------
* Example For UK
* London ------------> <channel update="i" site="ontvtonight" site_id="London" xmltv_id="dummy">dummy</channel>
* Border+England ----> <channel update="i" site="ontvtonight" site_id="Border+England" xmltv_id="dummy">dummy</channel>
* <update>c2-Providers-London</update>
* or
* <update>c2-Providers-Border-England</update>
*
* For Ireland
* Ireland -----------> <channel update="i" site="ontvtonight" site_id="Ireland" xmltv_id="dummy">dummy</channel>
* <update>c2-Providers-Ireland</update>
*
* Step 2: Create Channel List
*
* Use a channel line created from one of the providers above.
* <update>c3-10001-DTV</update>
* or
* <update>c3-M1R3C7-Bell</update>
* or
* <update>c3-London-Sky</update>
* or
* <update>c3-Ireland-Sky</update>
